function gotMessage(message, sender, sendResponse) {
    chrome.storage.local.get(["tabIds"], function(result){
        if (message.sNo && result.tabIds.includes(parseInt(message.tabID, 10))) {

            console.log("The content script has recieved the message!");
            sessionNo = message.sNo;
            let done = false;
    
            var interval = setInterval(function(){
                let target = "(" + sessionNo + ")";
                if (document.title.includes(target, 0)) {
                    // done = true;
                    clearInterval(interval);
                } else {
                    document.title = "(" + sessionNo + ")" + " " + document.title;
                }
            }, 4000);

            var intervalIcon = setInterval(function(){
                let target = document.getElementById('mehrohit');
                if (target) {
                    // done = true;
                    console.log('Clear Interval Started');
                    clearInterval(intervalIcon);
                    console.log('Clear Interval Ended');
                } else {
                    console.log('changed favicon');
                    var linked = document.createElement('link');
                    linked.type = 'image/x-icon';
                    linked.rel = 'shortcut icon';
                    linked.id = "mehrohit";
                    linked.href = base64URL[sessionNo];
                    document.getElementsByTagName('head')[0].appendChild(linked);             }
            }, 4000);
    
            var totalLinks = document.getElementsByTagName('link').length;
            for(var i = 0;i < totalLinks; i++){
                var t = document.getElementsByTagName('link')[i];
                var rel = t.rel;
                var id = t.id;
                if(rel.includes('icon') && id !== "mehrohit"){
                    t.parentNode.removeChild(t);
                }
            }
    
            var linked = document.createElement('link');
            linked.type = 'image/x-icon';
            linked.rel = 'shortcut icon';
            linked.id = "mehrohit";
            linked.href = base64URL[sessionNo];
            document.getElementsByTagName('head')[0].appendChild(linked);
    
        }
    });
    return true;
}

    

